import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import tileData from './tileData.js';
import CreateFormCard from './CreateFormCard';
import FormCard from './FormCard';

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
    marginTop: '20px',
  },
  gridList: {
    flexWrap: 'nowrap',
    // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
    transform: 'translateZ(0)',
  },
  title: {
    color: theme.palette.primary.light,
  },
}));

class FormCardList extends Component{
  constructor(){
    super()
    this.state={
      cards:tileData,
    }
  }

  render(){
    const classes = makeStyles(theme => ({
      root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'space-around',
        overflow: 'hidden',
        backgroundColor: theme.palette.background.paper,
        marginTop: '20px',
      },
      gridList: {
        flexWrap: 'nowrap',
        // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
        transform: 'translateZ(0)',
      },
      title: {
        color: theme.palette.primary.light,
      },
    }));

    return (
      <div className={classes.root}>
        <GridList className={classes.gridList} cols={3}>
          <GridListTile style={{height:'300px'}}>
              <CreateFormCard />
          </GridListTile>
          {this.state.cards.map(tile => (
            <GridListTile key={tile.img} style={{height:'300px'}}>
              <FormCard name={tile.title}/>
            </GridListTile>
          ))}
        </GridList>
      </div>
    );
  }
}

export default FormCardList;
